part of '../svg_helper.dart';

enum OnboardingImages {
  welcome,
  easyFoodOrdering,
  gettingStarted,
  helpAndSupport,
  readyToOrder;

  String _getCode({
    required String primaryColor,
    required String accentColor,
  }) {
    switch (this) {
      case OnboardingImages.welcome:
        return _Welcome.getCode(
          primaryColor: primaryColor,
          accentColor: accentColor,
        );
      case OnboardingImages.easyFoodOrdering:
        return _DonutLove.getCode(
          primaryColor: primaryColor,
          accentColor: accentColor,
        );
      case OnboardingImages.gettingStarted:
        return _SetupWizard.getCode(
          primaryColor: primaryColor,
          accentColor: accentColor,
        );
      case OnboardingImages.helpAndSupport:
        return _ActiveSupport.getCode(
          primaryColor: primaryColor,
          accentColor: accentColor,
        );
      case OnboardingImages.readyToOrder:
        return _OrderConfirmed.getCode(
          primaryColor: primaryColor,
          accentColor: accentColor,
        );
    }
  }
}

